using System;using System.Collections.Generic;using System.Text.Json.Serialization;namespace MicroFeel.Yonyou.Api{	public class Period	{		///<Summary>		///账套号		///</Summary>		[JsonPropertyName("cacc_id")]		public string CaccId { get;set; }		///<Summary>		///账簿年度		///</Summary>		[JsonPropertyName("iyear")]		public float Iyear { get;set; }		///<Summary>		///会计期间		///</Summary>		[JsonPropertyName("iid")]		public float Iid { get;set; }		///<Summary>		///开始日期		///</Summary>		[JsonPropertyName("dbegin")]		public DateTime Dbegin { get;set; }		///<Summary>		///结束日期		///</Summary>		[JsonPropertyName("dend")]		public DateTime Dend { get;set; }	}}